import React, {Component} from 'react';
import FlightServices from "../../../services/FlightServices";

class ArrivalFlightsComponent extends Component {
    constructor(props) {
        super(props);
        this.state = {
            arrivalFlights: []
        }
    }


    componentDidMount() {
        FlightServices.getArrivalFlight().then((response => {
            this.setState({arrivalFlights: response.data})
            console.log(response.data);
        }));
    }

    render() {
        return (
            <div>
                <h2 className="text-center">Arrival Flights</h2>

                <div className="row" style={{marginLeft:"10px",marginRight:"10px"}}>
                    <table className="table table-striped table-bordered">
                        <thead>
                        <tr>
                            <th>From Location</th>
                            <th>To Location</th>
                            <th>Departure Date Time</th>
                            <th>Landing Date time</th>
                            <th>Cost</th>
                        </tr>
                        </thead>
                        <tbody>
                        {
                            this.state.departureFlights.map(
                                flight =>
                                    <tr key={flight.id}>
                                        <td>{flight.fromLocation}</td>
                                        <td>{flight.toLocation}</td>
                                        <td>{flight.departureDateTime}</td>
                                        <td>{flight.landingDateTime}</td>
                                        <td>{flight.cost}</td>
                                        {/*<button onClick={() => this.editEmployee(employee.id)}*/}
                                        {/*        className="btn btn-info">Update*/}
                                        {/*</button>*/}
                                        {/*<button onClick={() => this.deleteEmployee(employee.id)}*/}
                                        {/*        className="btn btn-danger" style={{marginLeft: "10px"}}>Delete*/}
                                        {/*</button>*/}
                                        {/*<button onClick={() => this.viewDetailsEmployee(employee.id)}*/}
                                        {/*        className="btn btn-info" style={{marginLeft: "10px"}}>View Details*/}
                                        {/*</button>*/}
                                    </tr>
                            )
                        }
                        </tbody>
                    </table>
                </div>
            </div>
        );
    }
}

export default ArrivalFlightsComponent;
